import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/navbar";

import HeroCarousel from "./components/carousel";

const Home = () => (
  <div>
    <HeroCarousel />
  </div>
);const Destinations = () => <h1 className="text-3xl p-20">Explore Destinations</h1>;
const Services = () => <h1 className="text-3xl p-20">Our Services</h1>;
const Contact = () => <h1 className="text-3xl p-20">Contact Us</h1>;
const Login = () => <h1 className="text-3xl p-20">Login Page</h1>;

function App() {
  return (
    <Router>
      <Navbar />
      <div className="pt-20">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/destinations" element={<Destinations />} />
          <Route path="/services" element={<Services />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
